window.bookSummaryJSON = "<p>He's no fairy tale king.</p> <p>Levi</p> <p>Here, little princess. I'm your king.</p> <p>You have three rules. Bow. Break. Bend the knee.</p> <p>Fight me all you want, but soon enough, you'll be chanting long live the king.</p> <p>Astrid</p> <p>One day I'm Royal Elite School's small fly, the next I'm hunted and left to die.</p> <p>He doesn't only shred my life to parts, but he's also coming after my heart.</p> <p>He thinks he broke me, but the new princess will bring the king to his knees.</p> <p><i>Cruel King</i> is a complete stand-alone in Royal Elite world. No audiobook should be listened to prior to this.</p>"; 
